
/*
    2015 ICD-10-CM
    Index of Drugs and Chemicals
    https://www.cms.gov/Medicare/Coding/ICD10/2015-ICD-10-CM-and-GEMs.html
*/

CREATE TABLE DrugKind (
    DrugKindID      int PRIMARY KEY,
    DrugGroupKindID int REFERENCES DrugKind(DrugKindID),
    SeeDrugID       int,
    SeeAlsoDrugID   int,
    DrugCode1       char(7),
    DrugCode2       char(7),
    DrugCode3       char(7),
    DrugCode4       char(7),
    DrugCode5       char(7),
    DrugCode6       char(7),
    DrugName        varchar(100) NOT NULL
);


ALTER TABLE DrugKind ADD FOREIGN KEY (SeeDrugID)     REFERENCES DrugKind(DrugKindID);
ALTER TABLE DrugKind ADD FOREIGN KEY (SeeAlsoDrugID) REFERENCES DrugKind(DrugKindID);
